// --- Function node code ---
// Get the first item (same pattern you used)
const inputDate = new Date($input.first().json.currentDate);   // "2025-05-26T10:22:34.868+01:00"

// Helper to zero-pad to two digits
const pad = n => n.toString().padStart(2, '0');

// Date  →  MM/DD/YYYY
const formattedDate = `${pad(inputDate.getMonth() + 1)}/${pad(inputDate.getDate())}/${inputDate.getFullYear()}`;

// Time  →  HH:mm:ss   (24-hour clock)
const formattedTime = `${pad(inputDate.getHours())}:${pad(inputDate.getMinutes())}:${pad(inputDate.getSeconds())}`;

return [
  {
    json: {
      formattedDate,   // e.g. "05/26/2025"
      formattedTime    // e.g. "09:22:34"
    }
  }
];

const raw = $input.first().json.output

// Define regex patterns
const areaMatch = raw.match(/Area to Explore:\n([\s\S]*?)\n\n/);
const formatMatch = raw.match(/Potential Formats:\n([\s\S]*?)\n\n/);
const useMatch = raw.match(/Suggested Use:\n([\s\S]*?)\n\n/);
const thinkMatch = raw.match(/Something to Think About:\n([\s\S]*)/);

// Extract and trim each section
const area = areaMatch ? areaMatch[1].trim() : '';
const formatsRaw = formatMatch ? formatMatch[1].trim() : '';
const suggestedUse = useMatch ? useMatch[1].trim() : '';
const somethingToThinkAbout = thinkMatch ? thinkMatch[1].trim() : '';

// Split formats into array (assumes each line starts with "-")
const potentialFormats = formatsRaw
  .split('\n')
  .map(line => line.replace(/^-\s*/, '').trim())
  .filter(line => line.length > 0);

// Create pre-formatted HTML list
const formattedFormatsHTML = potentialFormats.map(f => `<li>${f}</li>`).join('');

return [
  {
    json: {
      areaToExplore: area,
      potentialFormats,
      formattedFormatsHTML,
      suggestedUse,
      somethingToThinkAbout
    }
  }
];
